def poly(xs, x):
    return sum([coeff * math.pow(x, i) for i, coeff in enumerate(xs)])

def derivative(xs, x):
    return sum([coeff * i * math.pow(x, i - 1) for i, coeff in enumerate(xs) if i > 0])

def newton_raphson(x0, epsilon, max_iter):
    for _ in range(max_iter):
        x1 = x0 - poly(xs, x0) / derivative(xs, x0)
        if abs(x1 - x0) < epsilon:
            return x1
        x0 = x1
    return x0

